import {BrowserRouter , Routes , Route} from 'react-router-dom'


import Rooms from "./components/Room";
import Footer from "./layout/Footer";
import Navbar from "./layout/Nav";


function App() {

  return (
    <BrowserRouter >
        <Navbar />
<Routes>
        <Rooms />
        <Footer />

        </Routes>
    </BrowserRouter>
  );
}

export default App;
